import React from "react";
import { FaDownload } from "react-icons/fa"; // Make sure you have react-icons installed

function Resume() {
  return (
    <div style={{ padding: "20px", maxWidth: "1200px", margin: "auto" }}>
      <div
        style={{
          display: "flex",
          alignItems: "flex-start",
          gap: "20px",
          flexWrap: "wrap",
        }}
      >
        <iframe
          src="/resume.pdf"
          style={{ flex: "1 1 70%", height: "900px", border: "none" }}
          title="Resume"
        />
        <a
          href="/resume.pdf"
          download
          style={{
            display: "flex",
            alignItems: "center",
            padding: "10px 20px",
            fontSize: "16px",
            color: "#f8f9f6",
            backgroundColor: "#4c7051",
            textDecoration: "none",
            borderRadius: "5px",
            border: "1px solid #4c7051",
            boxShadow: "0 4px 6px rgba(0,0,0,0.1)",
            whiteSpace: "nowrap",
          }}
        >
          <FaDownload style={{ marginRight: "8px" }} />
          Download Resume
        </a>
      </div>
    </div>
  );
}

export default Resume;
